try 
{ 
	$data = '';
	$index = isset($_GET['i']) ? $_GET['i'] : 0;
	if(!is_numeric($index))
		$index = 0;	
	$width = 16;
	$height = 16;
	$pack = imagecreatefromstring(base64_decode($data));
	$icon = imagecreatetruecolor($width,$height);
	$index = $index * $height;
	imagealphablending($icon,false);
	imagesavealpha($icon,true);
	imagecopy($icon,$pack,0,0,0,$index,$width,$height);
	header('Content-type: image/png');	
	imagepng($icon);
	imagedestroy($pack);
	imagedestroy($icon);
} 
catch (Exception $e) 
{
	throw $e;
}

